syntax = "proto3";

package warehousing.warehouse.v1;

//option java_package = "kyosk.protobuf.Warehouse.proto";
//option java_outer_classname = "Warehouse_Wrapper";

message Warehouse{

  string warehouse_id = 1;
  string warehouse_name = 2;
  int32 warehouse_type = 3;
  string warehouse_territory = 4;
  string warehouse_account = 5;
  string warehouse_contact_info = 6;
  string warehouse_company =7;
  string warehouse_location = 8;
}